    'To add "tags," click in the field, write something, and then press "Enter."' => 'Att lägga till en "tag", klicka i fältet och skriv något, tryck sedan på "Enter"',
    'Only letters, numbers, underscore (_) and the minus (-) character are allowed.' => 'Endast bokstäver, siffror, understreck (_) och minus (-) tecken är tillåtna.',
    'You now have three default customer groups.' => 'Du har nu tre standardgrupper för kunder.',
    'Mark all of the customer groups which you would like to have access to this category.' => 'Markera alla kundgrupper som ska ha tillgång till den här kategorin.',
    'Number of days this file can be accessed by customers. Set to zero for unlimited access.' => 'Antal dagar som den här filen kan kommas åt av kunder. Sätt till 0 för obegränsad åtkomst.',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Är produkten ett paket (en kombination av minst två befintliga produkter), en virtuell produkt (nerladdningsbar fil, tjänst etc.), eller en standard fysisk produkt?',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Kombinationer är olika varianter av en produkt, med attribut som storlek, vikt eller färg som har olika värden. Behöver din produkt kombinationer?',
