    'You can choose a minimum amount for the cart either with or without the taxes and shipping.' => 'Du kan välja en minsta summa för kundvagnen med eller utan moms samt med eller utan frakt.',
    'The cart rule will be applied to the first "X" customers only.' => 'Rabattkupongerna kommer endast att tillämpas på de första X kunderna .',
