    'Hi {firstname} {lastname},' => 'Hej {firstname} {lastname},',
    'You can review your order and download your invoice from the <a href="{history_url}">"Order history"</a> section of your customer account by clicking <a href="{my_account_url}">"My account"</a> on our shop.' => 'Du kan få en översyn av din order och ladda ner din faktura från <a href="{history_url}">"Order historik"</a>  sektionen från ditt konto genom att klicka <a href="{my_account_url}">"Mitt Konto"</a> i vår butik.',
    'If you have a guest account, you can follow your order via the <a href="{guest_tracking_url}?id_order={order_name}">"Guest Tracking"</a> section on our shop.' => 'Om du har ett gästkonto, kan du följa din order via <a href="{guest_tracking_url}?id_order={order_name}">"Gästspårning"</a> sektionen i vår butik.',
